class MonProfileComponent {
    constructor(auth, router, route, notifService) {
        this.auth = auth;
        this.router = router;
        this.route = route;
        this.notifService = notifService;
        this.credentials = {
            pseudo: "",
            email: "",
            abonneNews: true,
            success: "",
        };
    }
    ngOnInit() {
        this.auth.profile().subscribe((user) => {
            this.credentials = user;
        }, (err) => {
            console.error(err);
        });
        if (this.route.queryParams) {
            this.route.queryParams.subscribe((params) => {
                this.credentials.success = params.success;
            });
        }
    }
    updateProfile() {
        this.auth.updateProfile(this.credentials).subscribe((res) => {
            this.credentials.success = res.success;
            this.router.navigateByUrl("/profile").then(() => {
                if (this.credentials.abonneNews) {
                    this.notificationAbonne(this.credentials.pseudo);
                }
                // tslint:disable-next-line: deprecation
                setTimeout(window.location.reload.bind(window.location), 2500);
            });
        }, (err) => {
            console.error(err);
        });
    }
    //notification abonné
    notificationAbonne(pseudo) {
        let notif = {
            pseudo: pseudo,
            idRecette: null,
            type: "abonne",
        };
        this.notifService.addNotification(notif).subscribe();
    }
    deleteProfile(pseudo) {
        this.auth.logout();
        this.auth.deleteProfile(pseudo).subscribe((res) => {
            this.router.navigate(["/"]);
        }, (err) => {
            console.log(err);
        });
    }
}
